// src/Page1.jsx
import React from 'react';

function Page1() {
  return (
    <div style={styles.page}>
      <h1 style={styles.title}>Bienvenue sur la Page 1</h1>
      <p style={styles.text}>
        Ceci est une page React avec du contenu statique. Tu peux modifier ce texte comme tu veux.
      </p>
      <img src="/logo.png" alt="Logo React" style={styles.image} />
    </div>
  );
}

// Quelques styles en JS (optionnel)
const styles = {
  page: {
    padding: '20px',
    fontFamily: 'Arial, sans-serif',
  },
  title: {
    color: '#2c3e50',
  },
  text: {
    color: '#555',
    fontSize: '18px',
  },
  image: {
    marginTop: '20px',
    width: '100px',
  },
};

export default Page1;
